import { Link } from 'react-router-dom'; // Para navegar entre as páginas
import "../styles/navbar.css";

function Navbar() {
  return (
    
    <nav>
      <ul>
        <li><Link to="/">Home</Link></li>
        <li><Link to="/nousNova">Nous Nova</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
